    this.state = {
      email: '',
      password: ''
    }
  }
  render() {
    return(
      <div>
      <h1 onClick={() => this.setState({email: 'TELLO'})}>TESTE</h1>
      <h1>{this.state.email}</h1>
      <form>
      <input
        onChange={(e, value) => console.log(value)}//this.setState({email: value})} 
        value={this.state.email}
        placeholder='MANY'
      /></form>
      </div>
    )
  }
}
